    "Common Loon research at Seney National Wildlife Refuge : 2007 field season",nt"tracking_summary":
    {ntt"total": 9,ntt"recent": 2nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2016-07-27T22:44:29.040743",nt"name": "common-loon-research-at-seney-national-wildlife-refuge-2007-field-season",nt"isopen":
    false,nt"url": null,nt"notes": "In the early spring of 2007, after a winter
    spent on southern waters, adult common loons (Gavia immer) once again returned to
    the managed impoundments of Seney National Wildlife Refuge. Many of these males
    and females quickly formed or re-formed pair bonds, and promptly established large
    territories u2013 typically one or two per pool u2013 into which intruders were
    understood to proceed with risk. These pairs then set about the business of nesting,
    and u2013 if a month-long incubation of eggs proved successful u2013 subsequently
    hatched one or two chicks in June or July. Although the ensuing duties of parenting
    occupied the majority of their responsibilities, time and energy was often necessitated
    in other capacities as well: In addition to breeding pairs, the refuge harbored
    numerous lone adults who, when not feeding upon non-territorial pool regions, frequently
    did proceed with risk into the domain of these established partnerships. The duration
    and tenor of these intrusions varied widely. While the incursions were often brief
    and without confrontation, occasionally an encounter escalated to the point of vocal
    or physical aggression. Less frequently, this tumult resulted in a dramatic shift
    u2013 the eviction of a breeding adult from its territory by an intruder.",nt"license_title":
